// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;
import "./models/Agente.sol";
import "./models/InfoContrato.sol";
import "./libraries/StringLibrary.sol";
import "./Comercializador.sol";

contract Cliente is Agente {
    using StringLibrary for string;
    struct InfoEnergia {
        uint256 cantidad;
        string nombreTipoEnergia;
    }

    event NecesidadEnergia(string, uint256);

    constructor(InfoContrato memory _infoContrato, address _reguladorMercado) {
        reguladorMercado = _reguladorMercado;
        infoContrato = InfoContrato(
            address(this),
            _infoContrato.owner,
            _infoContrato.nit,
            _infoContrato.empresa,
            _infoContrato.contacto,
            _infoContrato.telefono,
            _infoContrato.correo,
            _infoContrato.departamento,
            _infoContrato.ciudad,
            _infoContrato.direccion,
            nullAddress,
            _infoContrato.tipoComercio
        );
    }

    function contratarComercializador(address _contratoComercializador)
        public
        authorize(msg.sender)
    {
        uint256 tipoComercializador = Comercializador(_contratoComercializador)
            .getTipoContrato();
        require(
            tipoComercializador == 0,
            "El comercializador debe ser de tipo Cliente"
        );
        infoContrato.comercializador = _contratoComercializador;
        Comercializador(_contratoComercializador).setClientesComercializador(
            msg.sender,
            infoContrato.owner
        );
    }

    function comprarEnergia(
        string memory _tipoEnergia,
        uint256 _cantidadEnergia
    ) public authorize(msg.sender) {
        require(
            infoContrato.comercializador != address(0),
            "No tienes contrato de comercializador"
        );
        require(
            Comercializador(infoContrato.comercializador).getTipoContrato() ==
                1,
            "El comercializador debe ser de tipo Cliente"
        );
        emit NecesidadEnergia(_tipoEnergia, _cantidadEnergia);
    }

    function getEnergiaCliente(string memory _tipoEnergia)
        public
        view
        returns (InfoEnergia memory)
    {
        if (
            !_tipoEnergia.equals("solar") ||
            !_tipoEnergia.equals("eolica") ||
            !_tipoEnergia.equals("hidraulica")
        ) {
            require(false, "El tipo de energia no es valido");
        }

        uint256 cantidadEnergia = Comercializador(infoContrato.comercializador)
            .getEnergiaDisponible(_tipoEnergia, infoContrato.owner);

        return InfoEnergia(cantidadEnergia, _tipoEnergia);
    }
}
